import React, {Component} from "react";
import "./App.css";
import {Form, FormGroup, Input, Label} from "reactstrap";

class ver extends Component {
  state = {
    fields: {}
  };

  mapStyles = {
    width: '100%',
    height: '100%'
  };
  containerStyle = {
    width: '400px',
    height: '400px'
  };

  center = {
    lat:37.7241,
    lng: 122.4799
  };

  MyMapComponent = withScriptjs(withGoogleMap((props) =>
<GoogleMap
  defaultZoom={8}
  defaultCenter={{ lat: 37.7241, lng: 122.4799}}
>
  {props.isMarkerShown && <Marker position={{ lat: -34.397, lng: 150.644 }} />}
</GoogleMap>
))
  MyComponent() {
    const [map, setMap] = React.useState(null)

    onLoad = React.useCallback(function callback(map) {
      bounds = new window.google.maps.LatLngBounds();
      map.fitBounds(bounds);
      setMap(map)
    }, [])

   onUnmount = React.useCallback(function callback(map) {
      setMap(null)
    }, [])
  }

  render() {
    // console.log('this.props => ', this.props);
    const {values = {}} = this.props.location;
    const {
      firstName, lastName, state,city,address,pincode,birthDate,
      education,feet,inches,phoneNumber,email
    } = values;
    // console.log('values => ', values);
    return (
      <div className="ver">
      <div className="container">
        <div>
          <div className="card">
      <span><div className="card-header font-weight:bold text-center ">
      <h2>CSC 642 Summer 2020 Individual Assignment Megha Babariya</h2>
      </div></span></div>
          <Form className="login-form">
            <h1><span className="font-weight-bold">Data Survey Verification Form</span></h1>
            <FormGroup>              
                <h5> First Name :{firstName}</h5>
                <h5> Last Name : {lastName} </h5>   
                <h5>State :{state} </h5>   
                <h5> City : {city} {pincode} </h5>        
                <h5>address : {address}</h5>
                <h5> Education: {education}</h5>
                <h5> Birthdate : {birthDate}</h5>
                <h5>Height : Feet {feet} inches {inches}</h5>
                <h5>Phone Number: {phoneNumber}</h5>
                <h5> Email : {email}</h5>

              </FormGroup>
              </Form>

        {/* <p>hello {firstName} {lastName}</p> */}
      </div></div></div>
    );
  }
}

export default ver;
